[{"location":"#SpatioTemporalTraits","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits","text":"","category":"section"},{"location":"","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits","text":"Modules = [SpatioTemporalTraits]","category":"page"},{"location":"#SpatioTemporalTraits.assert_timedim_last-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.assert_timedim_last","text":"assert_timedim_last(x)\n\nThrow an error if the x has a time dimension that is not the last dimension.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.depth-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.depth","text":"depth(x)\n\nReturns the size of the dimension corresponding to depth.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.duration-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.duration","text":"duration(x)\n\nDuration of the event along the time axis.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.has_timedim-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.has_timedim","text":"has_timedim(x) -> Bool\n\nReturns 'true' if x has a time dimension.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.height-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.height","text":"height(x)\n\nReturns the size of the dimension corresponding to height.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.is_spatial-Tuple{Symbol}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.is_spatial","text":"is_spatial(x::StaticSymbol) -> StaticBool\n\nReturns static(true) if x refers to a spatial dimension. By default, any dimension that is not one of the following is considered spatial:\n\ntime, Time\nchannels, Channels\nobservations, Observations, obs\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.is_temporal-Tuple{Symbol}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.is_temporal","text":"is_temporal(x) -> StaticBool\n\nReturns True if x refers to time.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.ntimes-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.ntimes","text":"ntimes(x) -> Integer\n\nReturns the number of elements along the time dimension.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.origin-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.origin","text":"origin(x) -> Tuple\n\nReturns the spatial origin of x.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.pixel_spacing-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.pixel_spacing","text":"pixel_spacing(x)\n\nReturn a tuple representing the separation between adjacent pixels along each axis of the image. Derived from the step size of each element of spatial_indices.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.sampling_rate-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.sampling_rate","text":"sampling_rate(x)\n\nNumber of samples per second.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.sdims-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.sdims","text":"sdims(x) -> Int\n\nReturn the number of spatial dimensions that x has.\n\nSee also: spatialdims, is_spatial\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.spatial_directions-Tuple{X} where X","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.spatial_directions","text":"spatial_directions(img) -> (axis1, axis2, ...)\n\nReturn a tuple-of-tuples, each axis[i] representing the displacement vector between adjacent pixels along spatial axis i of the image array, relative to some external coordinate system (\"physical coordinates\").\n\nBy default this is computed from pixel_spacing, but you can set this manually using ImageMeta.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.spatial_first-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.spatial_first","text":"spatial_first(x)\n\nThe first position along each spatial indices (i.e., where each spatial axis starts).\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.spatial_indices-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.spatial_indices","text":"spatial_indices(x)\n\nReturns the keys along each spatial dimension.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.spatial_last-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.spatial_last","text":"spatial_last(x)\n\nThe last position along each spatial indices (i.e., where each spatial axis stops).\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.spatial_order-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.spatial_order","text":"spatial_order(x) -> Tuple\n\nReturns the dimnames of x that correspond to spatial dimensions, as determined by is_spatial. At most three dimensions will be considered spatial.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.spatialdims-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.spatialdims","text":"spatialdims(x) -> Tuple{Vararg{StaticInt}}\n\nReturn a tuple of the spatial dimensions of x. \n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.time_first-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.time_first","text":"time_first(x)\n\nFirst time point along the time axis.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.time_last-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.time_last","text":"time_last(x)\n\nLast time point along the time axis.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.time_step-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.time_step","text":"time_step(x)\n\nThe time step/interval between each element.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.timedim-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.timedim","text":"timedim(::Type{T}) -> Integer\n\nReturns the dimension associated with time.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.times-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.times","text":"times(x)\n\nReturns a collection of times associated with x. If x has a specific dimension associated with time, this returns the keys along that dimension.\n\n\n\n\n\n","category":"method"},{"location":"#SpatioTemporalTraits.width-Tuple{Any}","page":"SpatioTemporalTraits","title":"SpatioTemporalTraits.width","text":"width(x)\n\nReturns the size of the dimension corresponding to width.\n\n\n\n\n\n","category":"method"}]
